When Bro Nigel Farage is Prime Minister:
• I warn you not to be ordinary;
• I warn you not to need education;
• I warn you not to need childcare;
• I warn you not to be poor or unemployed;
• I warn you not to fall sick;
• I warn you not to be black; and
• I warn you not to grow old.

Reform UK promises:
• Fox hunting;
• Abolish marriage equality;
• More fatal road accidents;
• Destitution for the unemployed;
• Tax relief for paedophile Freemasons;
• Public hangings of parents who steal to feed their children;
• Beggars pleading for food from cars waiting at traffic lights.
